import React from "react";
import { Link } from "react-router-dom";
import { motion } from "framer-motion";

const HomePage = () => {
  // Header animation
  const headerVariants = {
    hidden: { opacity: 0, y: -50 },
    visible: { opacity: 1, y: 0, transition: { duration: 1 } },
  };

  // Hero text
  const heroTextVariants = {
    hidden: { opacity: 0 },
    visible: { opacity: 1, transition: { staggerChildren: 0.3 } },
  };

  const textVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0, transition: { duration: 0.8 } },
  };

  const buttonVariants = {
    hover: {
      scale: 1.1,
      backgroundColor: "#fcd34d",
      color: "#000",
      boxShadow: "0px 0px 30px #fcd34d",
      transition: { duration: 0.3 },
    },
    tap: { scale: 0.95 },
  };

  const floatingVariants = (delay) => ({
    animate: {
      y: [0, -25, 0],
      x: [0, 25, 0],
      transition: { duration: 7, repeat: Infinity, delay, ease: "easeInOut" },
    },
  });

  return (
    <div className="relative min-h-screen flex flex-col overflow-hidden bg-gradient-to-br from-[#0f172a] via-[#1e293b] to-[#0f172a]">
      {/* Video Background */}
      <video
        autoPlay
        loop
        muted
        className="absolute inset-0 w-full h-full object-cover z-0 brightness-75"
        src="hd.mp4"
        type="video/mp4"
      />

      {/* Floating Neon Blobs */}
      <motion.div className="absolute top-16 left-8 w-40 h-40 bg-yellow-400 rounded-full opacity-40 blur-3xl z-5" variants={floatingVariants(0)} animate="animate" />
      <motion.div className="absolute top-1/2 right-16 w-56 h-56 bg-pink-400 rounded-full opacity-25 blur-3xl z-5" variants={floatingVariants(2)} animate="animate" />
      <motion.div className="absolute bottom-12 left-1/3 w-36 h-36 bg-purple-500 rounded-full opacity-30 blur-3xl z-5" variants={floatingVariants(4)} animate="animate" />

      {/* Overlay */}
      <div className="absolute inset-0 bg-black/60 z-10"></div>

      {/* Header */}
      <motion.header
        className="relative z-20 flex items-center justify-between px-6 md:px-10 py-5 backdrop-blur-md"
        variants={headerVariants}
        initial="hidden"
        animate="visible"
      >
        <motion.div
          className="text-4xl md:text-5xl font-extrabold text-white cursor-pointer"
          style={{ fontFamily: '"Kablammo", system-ui' }}
          whileHover={{ scale: 1.15, color: "#facc15" }}
        >
          Matty
        </motion.div>

        <nav className="flex items-center gap-6 md:gap-10 text-white font-medium text-sm md:text-base">
          <motion.div whileHover={{ scale: 1.1, color: "#fcd34d" }}>
            <Link to="/about">About Us</Link>
          </motion.div>
          <motion.div whileHover={{ scale: 1.1, color: "#fcd34d" }}>
            <a href="#">Our Blog</a>
          </motion.div>
          <motion.div whileHover={{ scale: 1.1, color: "#fcd34d" }}>
            <a href="#">Contact Us</a>
          </motion.div>
          <motion.div whileHover={buttonVariants.hover} whileTap={buttonVariants.tap}>
            <Link
              to="/login"
              className="px-5 md:px-7 py-2 md:py-3 rounded-full border border-white text-white font-semibold bg-transparent transition-all duration-300"
            >
              Login
            </Link>
          </motion.div>
        </nav>
      </motion.header>

      {/* Hero Section */}
      <main className="relative z-20 flex flex-col items-center justify-center flex-1 text-center px-6 md:px-0">
        <motion.div
          className="space-y-5 md:space-y-8"
          variants={heroTextVariants}
          initial="hidden"
          animate="visible"
        >
          <motion.h1 className="text-4xl md:text-7xl font-extrabold text-white leading-tight" variants={textVariants}>
            Think, plan, and create
          </motion.h1>
          <motion.h2 className="text-2xl md:text-4xl text-yellow-400 font-semibold tracking-wide" variants={textVariants}>
            All in one place
          </motion.h2>
          <motion.p className="text-base md:text-lg text-gray-200 max-w-xl mx-auto" variants={textVariants}>
            Efficiently design, organize, and save your creative work with Matty. Everything you need to unleash your creativity is right here.
          </motion.p>
          <motion.div variants={buttonVariants} whileHover="hover" whileTap="tap" className="mt-6 md:mt-8">
            <Link
              to="/register"
              className="text-2xl md:text-3xl px-10 md:px-14 py-3 md:py-5 rounded-full border border-white text-white font-semibold bg-transparent transition-all duration-300 hover:shadow-lg hover:shadow-yellow-400/50"
            >
              Start Designing
            </Link>
          </motion.div>
        </motion.div>

        {/* Scroll Indicator */}
        <motion.div
          className="absolute bottom-6 md:bottom-10 w-6 h-6 border-2 border-white rounded-full animate-bounce"
          animate={{ y: [0, 10, 0] }}
          transition={{ repeat: Infinity, duration: 1.5 }}
        ></motion.div>
      </main>

      {/* Footer */}
      <motion.footer
        className="relative z-20 py-5 md:py-6 text-center text-gray-300 text-xs md:text-sm border-t border-gray-500/20"
        variants={textVariants}
        initial="hidden"
        animate="visible"
      >
        &copy; 2025 Matty. All rights reserved.
      </motion.footer>
    </div>
  );
};

export default HomePage;
